def lengthOfLongestSubstring(s):
    arr=[]
    for i in range(255-33):
        arr.append(0)
    max_length=0
    t_length=0
    for i in range(len(s)):
        x=s[i]
        t=ord(x)-33
        arr[t]=arr[t]+1
        t_length=t_length+1
        if arr[t] >1:
            for j in range(i-t_length+1,i):
                k=ord(s[j])-33
                arr[k]=0
                if(s[j]==x):
                    t_length=i-j
                    break
            arr[t]=1
        if t_length>max_length:
            max_length=t_length
    return max_length

